import React from 'react';
import imagenes from "../assets/imagenes";
import { makeStyles } from '@material-ui/core/styles';
import Actividades from '../componentes/MenuActividades';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Campismo from '../views/Campismo';

function Home() {
  const Actividades = () => {
    return(
    <div>
        <h2 className="text-center">Home</h2>                    
        <img resizeMethod = "contain" src={imagenes.img1}/>
        <Actividades/> 
        <Router>
          <Switch>
            <Route exact path="campismo" component={Campismo}>

            </Route>
          </Switch>
        
        </Router>

    </div>                               
                
  )      
  };
};
export default Home;

